[{'comment_id': 474977556, 'comment_body': 'The output format should not be determined by an environment variable within a filter function. Generally filter functions should not be controlled by environment variables.
To run filters in different modes, or generally to pass control parameters to them, the filter call scheme contains:
```
                  void *parameters);
```
So for this filter the user supplies the output mode through the filter parameters.
Simply do right in the beginning of the main function:
```
if (parameters)
  outformat = (OutFormatType)(*parameters);
else
  outformat = OUTPUT_FORMAT_PDF;
```
The filter function has to be called with the parameters pointer pointing to a variable of the type `OutFormatType`, set to the desired output type. If it is set to an invalid type or if NULL is supplied as parameters pointer, the output typr defaults to standard PDF.
In the wrapper program to get a CUPS filter from this you call:
In `rastertopdf`
```
outformat = OUTPUT_FORMAT_PDF;
ret = filterCUPSWrapper(argc, argv, rastertopdf, &outformat, &JobCanceled);
```
In `rastertopclm`
```
outformat = OUTPUT_FORMAT_PCLM;
ret = filterCUPSWrapper(argc, argv, rastertopdf, &outformat, &JobCanceled);
```
Wrapper scripts are then not needed any more.', 'comment_created': datetime.datetime(2020, 8, 21, 21, 27, 51, tzinfo=datetime.timezone.utc), 'commenter': 'tillkamppeter', 'type': 'User'}, {'comment_id': 475052266, 'comment_body': '@tillkamppeter Done. Also the filterCupsWrapper needed a fix to pass the parameters. Done that too.', 'comment_created': datetime.datetime(2020, 8, 22, 6, 7, 17, tzinfo=datetime.timezone.utc), 'commenter': 'JaiLuthra1', 'type': 'User'}, {'comment_id': 475055802, 'comment_body': 'Now it is all correct. Thank you.', 'comment_created': datetime.datetime(2020, 8, 22, 6, 51, 52, tzinfo=datetime.timezone.utc), 'commenter': 'tillkamppeter', 'type': 'User'}, {'comment_id': 475055859, 'comment_body': 'And also thanks for fixing my little oversight in filterCupsWrapper().', 'comment_created': datetime.datetime(2020, 8, 22, 6, 52, 36, tzinfo=datetime.timezone.utc), 'commenter': 'tillkamppeter', 'type': 'User'}]
